const ListingThumb = props => {
  return (
    <Row className="listingThumb">
      <Col lg={12}>
        <Row>
          <Col>
            <h1>{props.job.jobTitle}</h1>
          </Col>
        </Row>
        <Row>
          <Col>
            <h2>{props.job.company}</h2>
